import { Box, withStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  isOpen: boolean;
  handleClose: Function;
}

const Dialog: React.FC<IProps> = ({ isOpen, handleClose }) => {
  return (
    <>
      {isOpen && (
        <>
          <Backdrop onClick={() => handleClose()}></Backdrop>
        </>
      )}
    </>
  );
};

export default Dialog;

const Backdrop = withStyles({
  root: {
    position: "fixed",
    top: 0,
    left: 0,
    bottom: 0,
    right: 0,
    backgroundColor: "black",
    opacity: 0.5,
    zIndex: 10000,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
})(Box);
